using System;
using System.Collections.Generic;
using System.Configuration;
using System.Linq;
using System.Net;
using System.Net.Http;
using System.Text;
using System.Web.Http;
using System.Xml.Linq;
using Microsoft.VisualStudio.TestTools.UnitTesting;
using CodeChallenge;
using CodeChallenge.Controllers;
using CodeChallenge.Models;

namespace CodeChallenge.Tests.Controllers {
  [TestClass]
  public class FlickrRestRequestTest {
    [TestMethod]
    public void Get_EmptyURL_ReturnsIResponseBadRequest() {
      // Arrange

      // Act
      IResponse result = new FlickrRestRequest().Get(string.Empty);

      // Assert
      Assert.IsNotNull(result);
      Assert.IsTrue(result.StatusCode == HttpStatusCode.BadRequest);
    }

    [TestMethod]
    public void Get_CallFlickrApi_ReturnsActualResponse() {
      // Arrange
      var baseUrl = ConfigurationManager.AppSettings["FlickrBaseUrl"];
      var url = $"{baseUrl}?tags=Lucky";

      // Act
      IResponse result = new FlickrRestRequest().Get(url);

      // Assert
      Assert.IsNotNull(result);
    }

    [TestMethod]
    public void Get_CallInvalidUrl_CatchExceptionAndReturn() {
      // Arrange

      // Act
      IResponse result = new FlickrRestRequest().Get("badurl");

      // Assert
      Assert.IsNotNull(result);
      Assert.IsNotNull(result.Ex);
    }

    [TestMethod]
    public void FormatXmlToJson_NullInput_ReturnNoContent() {
      // Arrange

      // Act
      IResponse result = new FlickrRestRequest().FormatXmlToJson(null, null);

      // Assert
      Assert.IsNotNull(result);
      Assert.IsNotNull(result.Ex);
      Assert.AreEqual(result.StatusCode, HttpStatusCode.NoContent);
    }

