s/tags/\" /><category term=\"diecast\" scheme=\"https://www.flickr.com/photos/tags/\" /><category term=\"blue\" scheme=\"https://www.flickr.com/photos/tags/\" /><category term=\"metallic\" scheme=\"https://www.flickr.com/photos/tags/\" /><category term=\"bahama\" scheme=\"https://www.flickr.com/photos/tags/\" /><category term=\"mist\" scheme=\"https://www.flickr.com/photos/tags/\" /><category term=\"118\" scheme=\"https://www.flickr.com/photos/tags/\" /><category term=\"1950\" scheme=\"https://www.flickr.com/photos/tags/\" /><category term=\"landyacht\" scheme=\"https://www.flickr.com/photos/tags/\" /><category term=\"americana\" scheme=\"https://www.flickr.com/photos/tags/\" /><category term=\"auto\" scheme=\"https://www.flickr.com/photos/tags/\" /><category term=\"aeronauticdk\" scheme=\"https://www.flickr.com/photos/tags/\" /><category term=\"aeronautic\" scheme=\"https://www.flickr.com/photos/tags/\" /><category term=\"pictures\" scheme=\"https://www.flickr.com/photos/tags/\" /><category term=\"modelcar\" scheme=\"https://www.flickr.com/photos/tags/\" /><category term=\"showroom\" scheme=\"https://www.flickr.com/photos/tags/\" /><displaycategories></displaycategories></entry><entry><title>Gotokuji Temple | Tokyo, Japan</title><link rel=\"alternate\" type=\"text/html\" href=\"https://www.flickr.com/photos/ping_timeout/45954949271/\"/><id>tag:flickr.com,2005:/photo/45954949271</id><published>2018-11-19T14:10:30Z</published><updated>2018-11-19T14:10:30Z</updated><flickr:date_taken>2018-10-27T10:12:52-08:00</flickr:date_taken><dc:date.Taken>2018-10-27T10:12:52-08:00</dc:date.Taken><content type=\"html\">&lt;p&gt;&lt;a href=&quot;https://www.flickr.com/people/ping_timeout/&quot;&gt;Ping Timeout&lt;/a&gt; posted a photo:&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://www.flickr.com/photos/ping_timeout/45954949271/&quot; title=&quot;Gotokuji Temple | Tokyo, Japan&quot;&gt;&lt;img src=&quot;https://farm5.staticflickr.com/4848/45954949271_9c2b33d6cc_m.jpg&quot; width=&quot;240&quot; height=&quot;159&quot; alt=&quot;Gotokuji Temple | Tokyo, Japan&quot; /&gt;&lt;/a&gt;&lt;/p&gt;&lt;p&gt;Found a Maneki Neko cat hidden inside one of the lamppost at the temple ground.&lt;br /&gt;&lt;br /&gt;The maneki-neko (招き猫) is a common Japanese figurine (lucky charm, talisman) which is often believed to bring good luck to the owner. In modern times, they are usually made of ceramic or plastic. The figurine depicts a cat (traditionally a calico Japanese Bobtail) beckoning with an upright paw, and is usually displayed in—often at the entrance of—shops, restaurants, pachinko parlors, and other businesses. Some of the sculptures are electric or battery-powered and have a slow-moving paw beckoning.&lt;br /&gt;&lt;br /&gt;It's believed to originate from the Edo period, when a feudal lord from Hikone (a city in present-day Shiga Prefecture) passed by a temple in Edo. There, he met a cat that beckoned him to come into the temple. The lord followed the cat and decided to stop by the temple, soon after, a thunderstorm came by. The lord, who took shelter at the temple, became thankful of the cat's deed; eventually, he collected enough funds to rebuild and claim the temple as his family temple, which eventually became Gotokuji. As time went on, people began to offer maneki neko figurines to the temple as a sign of gratitude when their wishes came true.&lt;/p&gt;</content><author><name>Ping Timeout</name><uri>https://www.flickr.com/people/ping_timeout/</uri><flickr:nsid>10757800@N00</flickr:nsid><flickr:buddyicon>https://farm5.staticflickr.com/4429/buddyicons/10757800@N00.jpg?1503803629#10757800@N00</flickr:buddyicon></author><link rel=\"enclosure\" type=\"image/jpeg\" href=\"https://farm5.staticflickr.com/4848/45954949271_9c2b33d6cc_b.jpg\" /><category term=\"okyo\" scheme=\"https://www.flickr.com/photos/tags/\" /><category term=\"japan\" scheme=\"https://www.flickr.com/photos/tags/\" /><category term=\"nippon\" scheme=\"https://www.flickr.com/photos/tags/\" /><ca